rawData = "";
var dynamicData;

function conclusion_5_1() {
	dynamicData = stringToCharArray(rawData);
	return conclusion_5_aux();
}

// 	dynamicData is already provided before this method !
function conclusion_5_aux() {
	var total = dynamicData.length;
	var intervalsEmpty = []; // Contains the indexes (between 0 and length-1) of empty spaces
	var interval;
	for (var i = 0 ; i < dynamicData.length-1 ; i++) {
		if (tryAndReduce(i, i+1)) {
			intervalsEmpty.push([i, i+1]);
			total -= 2;
		}
	}
	// Repeat until nothing can be done :
	var somethingDone, fV;
	do {
		// Reduce list of intervals such that it is merged...
		do {
			somethingDone = false;
			for (var i = 0 ; i < intervalsEmpty.length-1 ; i++) { 
				if (intervalsEmpty[i][1] +1 == intervalsEmpty[i+1][0]) {
					intervalsEmpty[i+1] = [intervalsEmpty[i][0], intervalsEmpty[i+1][1]];
					intervalsEmpty[i] = [];
				}
			}
			fV = intervalsEmpty.length;
			intervalsEmpty = intervalsEmpty.filter(function(inter) {return inter.length > 0});
			somethingDone = (fV != intervalsEmpty.length);
		} while (somethingDone);
		// ... and, for each interval, expand it as much as possible by eliminating its reactions (empty spaces stop expansion). 
		fV = total;
		for (var i = 0 ; i < intervalsEmpty.length ; i++) {
			while (intervalsEmpty[i][0] != 0 && intervalsEmpty[i][1] != dynamicData.length-1 && tryAndReduce(intervalsEmpty[i][0]-1, intervalsEmpty[i][1]+1)) { // 0 and length-1, and not -1 and length !!!
				total -= 2;
				intervalsEmpty[i][0]--;
				intervalsEmpty[i][1]++;
			}
		}
		somethingDone = (fV != total);
	} while (somethingDone);
	return total;
}

function tryAndReduce(i, j) {
	if (dynamicData[i] != ' ' && dynamicData[j] != ' ' &&
		(charToASCIIRelativePosition(dynamicData[i], 'A') == charToASCIIRelativePosition(dynamicData[j], 'a') || 
		(charToASCIIRelativePosition(dynamicData[j], 'A') == charToASCIIRelativePosition(dynamicData[i], 'a')) ) )
		 {
			dynamicData[i] = ' ';
			dynamicData[j] = ' ';
			return true;
		}
	return false;
}

function conclusion_5_2() {
	dynamicData = stringToCharArray(rawData);
	conclusion_5_aux();
	var firstReducedData = dynamicData.filter(function(c) {return c != ' '})
	var bestTotal = rawData.length;
	var total;
	for (var i = 0 ; i <= 25 ; i++) {
		dynamicData = firstReducedData.slice();
		dynamicData = dynamicData.filter(function(c) {return c != asciiRelativePositionToChar(i, 'a') && c != asciiRelativePositionToChar(i, 'A')})
		bestTotal = Math.min(bestTotal, conclusion_5_aux());
	}
	return bestTotal;
}